import React from 'react';
import restaurant1 from './restaurant1.jpeg'


class Restaurants extends React.Component {

    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col-sm">
                        <img src={restaurant1} alt='restaurant' />
                    </div>
                    <div class="col">
                        <h3> Vegan Paradise</h3>
                        <p>Address: 37 Edge St, Manchester M4 1HW</p>
                        <p>Hours: 12-10PM</p>
                        <input class="dropdown-menu datepicker" data-date-format="mm/dd/yyyy"></input>
                        <button type="button" class="btn btn-primary btn-lg">Book</button>
                    </div>
                </div>
            </div>

        );
    }
}

export default Restaurants;
